package com.example.asm_java_nangcao1.Model;public class gioHang_Model {    private String idGioHang;    private String idSanPham;    private int soLuongSanPham;    public gioHang_Model() {    }    public gioHang_Model(String idGioHang, String idSanPham, int soLuongSanPham) {        this.idGioHang = idGioHang;        this.idSanPham = idSanPham;        this.soLuongSanPham = soLuongSanPham;    }    public String getIdGioHang() {        return idGioHang;    }    public void setIdGioHang(String idGioHang) {        this.idGioHang = idGioHang;    }    public String getIdSanPham() {        return idSanPham;    }    public void setIdSanPham(String idSanPham) {        this.idSanPham = idSanPham;    }    public int getSoLuongSanPham() {        return soLuongSanPham;    }    public void setSoLuongSanPham(int soLuongSanPham) {        this.soLuongSanPham = soLuongSanPham;    }}